import React from "react";

const Footer = () =>{
    return(
        <div id="contact" className="contact-section">
                <h2 className="section-heading">CONTACT</h2>
                <div className="row contact-content">
                    <div className="col col-2 contact-info">
                        <p><i className="ti-location-pin"> Chicago, US</i> </p>
                        <p><i className="ti-mobile"> Phone: +00 151515</i> </p>
                        <p><i className="ti-email"> Email: mail@mail.com</i> </p>
                        
                    </div>
                    
                </div>
            </div>
    )
}

export default Footer;
